enum Cw721ExecuteMsg {
    TransferNft {
            recipient: String,
            token_id: String,
        },
    SendNft {
            contract: String,
            token_id: String,
            msg: Binary,
        },
    Approve {
            spender: String,
            token_id: String,
            expires: Option<Expiration>,
        },
    Revoke {
            spender: String,
            token_id: String,
        },
    ApproveAll {
            operator: String,
            expires: Option<Expiration>,
        },
    RevokeAll {
            operator: String,
        },
    Burn {
            token_id: String,
        },
}

enum Cw721QueryMsg {
    OwnerOf {
            token_id: String,
            include_expired: Option<bool>,
        },
    Approval {
            token_id: String,
            spender: String,
            include_expired: Option<bool>,
        },
    Approvals {
            token_id: String,
            include_expired: Option<bool>,
        },
    AllOperators {
            owner: String,
            include_expired: Option<bool>,
            start_after: Option<String>,
            limit: Option<u32>,
        },
    NumTokens {
        },
    ContractInfo {
        },
    NftInfo {
            token_id: String,
        },
    AllNftInfo {
            token_id: String,
            include_expired: Option<bool>,
        },
    Tokens {
            owner: String,
            start_after: Option<String>,
            limit: Option<u32>,
        },
    AllTokens {
            start_after: Option<String>,
            limit: Option<u32>,
        },
}

fn send_nft<'_,
'_>(&'_ Self, DepsMut, Env, MessageInfo, String, String, Binary)
-> Result<Response<C>, Self::Err>

fn approve<'_,
'_>(&'_ Self, DepsMut, Env, MessageInfo, String, String, Option<Expiration>)
-> Result<Response<C>, Self::Err>

fn approve_all<'_,
'_>(&'_ Self, DepsMut, Env, MessageInfo, String, Option<Expiration>)
-> Result<Response<C>, Self::Err>

fn operators<'_,
'_>(&'_ Self, Deps, Env, String, bool, Option<String>, Option<u32>)
-> StdResult<OperatorsResponse>
